import React from "react";
import {
    Link
} from 'react-router-dom'

export const Footer = () => {
 return<footer>
    <div id="Footer_Nevbar_Container">
        <Link><p className="Footer_nevbar_Link">About us</p></Link>
        <Link><p className="Footer_nevbar_Link">Community</p></Link>
        <Link><p className="Footer_nevbar_Link">How to Contact</p></Link>
        <Link><p className="Footer_nevbar_Link">Notice</p></Link>
    </div>
 </footer>
}

export default Footer
